    <style type="text/css">
      body,
      html {
        height: 100%;
        background-size: cover;
      }
      .app-loading {
        position: absolute;
        top: 0;
        left: 0;
        bottom: 0;
        right: 0;
        /* background: #111B3B; */
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
      }

      .app-loading .spinner {
        height: 300px;
        width: 300px;
        animation: rotate 12s linear infinite;
        transform-origin: center center;
        position: absolute;
        top: 0;
        bottom: 0;
        left: 0;
        right: 0;
        margin: auto;
      }

      .app-loading .spinner .path,
      .path {
        stroke-dasharray: 1, 200;
        stroke-dashoffset: 0;
        animation: dash 2.5s ease-in-out infinite;
        stroke-linecap: round;
        stroke: #1088f6;
      }

      .app-loading > .logo {
        width: 100px;
        height: 100px;
        background: url(../assets/icons/logo0.png) center center no-repeat;
        background-size: contain;
      }

      @keyframes rotate {
        100% {
          transform: rotate(360deg);
        }
      }

      @keyframes dash {
        0% {
          stroke-dasharray: 1, 200;
          stroke-dashoffset: 0;
        }
        50% {
          stroke-dasharray: 89, 200;
          stroke-dashoffset: -35px;
        }
        100% {
          stroke-dasharray: 89, 200;
          stroke-dashoffset: -124px;
        }
      }
    </style>
  <link rel="stylesheet" href="styles.82e4e9ee0bce0f553ab5.css"></head>

      <!-- <div class="logo"></div> -->
      <svg style="background: rgba(0,0,0,0);" class="spinner" viewBox="25 25 50 50">
        <circle
          class="path"
          cx="50"
          cy="50"
          r="20"
          fill="none"
          stroke-width="2"
          stroke-miterlimit="10"
        />
      </svg>
    </div>
